INSERT INTO `css_responses` (`id`, `status_type_id`, `date_transacted`, `date_accomplished`, `client_name`, `contact_details`, `sex_type_id`, `client_group_id`, `client_type_id`, `specify_client_type`, `region_id`, `transacting_office_id`, `availed_service_id`, `other_service_availed`, `awareness_response_id`, `visibility_response_id`, `helpfulness_response_id`, `responsiveness_rate_id`, `responsiveness_remarks`, `reliability_rate_id`, `reliability_remarks`, `facility_access_rate_id`, `facility_access_remarks`, `communication_rate_id`, `communication_remarks`, `cost_rate_id`, `cost_remarks`, `integrity_rate_id`, `integrity_remarks`, `assurance_rate_id`, `assurance_remarks`, `outcome_rate_id`, `outcome_remarks`, `overall_rate_id`, `overall_remarks`, `created_at`, `updated_at`) VALUES (877, 1, '2023-05-18', '2023-05-18', 'Almia, Jan Rona Paula D. ', 'jralmia.s11@gmail.com', 2, NULL, 3, NULL, NULL, 9, 25, 'Pharmacy Intership', NULL, NULL, NULL, 5, 'Theyre very nice and are willing to assist students that inquire about the topic at hand. ', 5, 'They have delivered it as promised. ', 4, 'Location-wise, very far from where I lived but other than that they have well-kept facilities and can be accessed whenever needed. ', 5, NULL, 5, NULL, 5, 'They have accommodated us with fairness and honesty. ', 5, 'Theyre very knowledgeable about their prepared topics. Also shown through their years of experience with these kinds of things. ', 5, NULL, 5, 'They are great mentors and help us understand the topics if we find it difficult. They are also approachable and friendly. Theyre very knowledgeable about the topics theyve given such as the GMP and PITAHC as well as the production process for sambong tablets, with IPAD and FPQC. Overall a fun and knowledgeable experience. ', '2024-01-17 11:04:45', '2024-01-17 11:04:45');
